    successful_conversions = []
    failed_conversions = {}
    success_count = 1
    fail_count = 0
    for item in list_of_strings:
        try:
            successful_conversions.append(float(item))
            success_count += 1
        except ValueError as e:
            failed_conversions[item] = str(e)
            fail_count += 1
